style.css:
/* Stylish */
body {
  background-color: #27254C;
  color: #F2ECF8;
  font-family: Arial, sans-serif;
  font-size: 16px;
  line-height: 1.5;
}

h1, h2, h3, h4, h5, h6 {
  font-weight: bold;
  margin: 0 0 1rem;
}

a {
  color: #45B0D2;
  text-decoration: none;
}

a:hover {
  text-decoration: underline;
}

button, input[type="submit"] {
  background-color: #564A94;
  border: none;
  border-radius: 4px;
  color: #F2ECF8;
  cursor: pointer;
  font-size: 16px;
  padding: 0.5rem 1rem;
  transition: background-color 0.2s ease-in-out;
}

button:hover, input[type="submit"]:hover {
  background-color: #9B8AB4;
}
